function TextField() {
    var a = {
        CONTENT_TYPE: {
            ALL_CHARS: 0,
            ALPHA_NUM: 1,
            ALPHA_ONLY: 2,
            NUM_ONLY: 3,
            EMAIL: 4,
            DOUBLE_ONLY: 5,
            TIME: 6,
            AMOUNT: 7
        }
    };

    function c(h, d) {
        h = h || window.event;
        var f = h.keyCode || h.charCode;
        if (f == 13) {
            return false
        }
        if (d == a.CONTENT_TYPE.ALPHA_ONLY) {
            return !((f < 65 || f > 90) && (f < 97 || f > 122))
        }
        if (d == a.CONTENT_TYPE.ALPHA_NUM) {
            return !((f < 48 || f > 57) && (f < 65 || f > 90) && (f < 97 || f > 122))
        }
        if (d == a.CONTENT_TYPE.NUM_ONLY) {
            return !(f < 48 || f > 57)
        }
        if (d == a.CONTENT_TYPE.DOUBLE_ONLY || d == a.CONTENT_TYPE.AMOUNT) {
            var g = (h.target ? h.target : h.srcElement).value;
            if (f == 46) {
                if (g.indexOf(".") > -1) {
                    return false
                }
            } else {
                if (f < 48 || f > 57) {
                    return false
                } else {
                    if (d == a.CONTENT_TYPE.AMOUNT && g.indexOf(".") > -1 && g.indexOf(".") + 3 < g.length) {
                        return false
                    }
                }
            }
        }
        return true
    }

    function b(d) {
        return ((d >= 48 && d <= 57) || (d >= 65 && d <= 90) || (d >= 97 && d <= 122))
    }
    TextField.prototype.keyPressTextField = function(g, f) {
        f = f || window.event;
        var d = f.keyCode || f.charCode;
        if (d != 13) {
            return c(f, $(g).attr("data-contenttype"))
        }
        return true
    }
}

function initTextFields() {
    var a = new TextField();
    $("[data-contenttype]").bind("keypress", function(b) {
        return a.keyPressTextField(this, b)
    })
};